import { BrowserRouter } from 'react-router-dom';
import createRoot from 'react-dom/client';

const rootNode=document.getElementById('root');

ReactDOM.createRoot(rootNode).render(
  <BrowserRouter>
    <App />
  </BrowserRouter>

);

